import React from 'react';
import {useSpring, animated} from 'react-spring';

const SideBar = ({ open }) => {
  open=true;
  
  const props = useSpring({ from: {opacity: 1}}, {to:{opacity:0 }});
  return (

<animated.h1 style={props}>hello</animated.h1>
  );
};


export default SideBar;
